    private void print(List<Integer> indexes, int length){
        List<String> startTags = indexes.stream()
                .map(i -> context.substring(i, length+i))
                .collect(Collectors.toList());
        Logger.V("Start tags:\n%s", String.join("... ", startTags));
    }

    @Test
    public void testAllIndexesOfText() throws Exception {
        List<Integer> indexes = StringExtensions.allIndexesOf(context, "<div");
        print(indexes, 5);

        indexes = StringExtensions.allIndexesOf(context, "<div class=\"g\">");
        print(indexes, "<div class=\"g\">".length());
    }

    @Test
    public void testAllIndexesOfPattern() throws Exception {
        List<Integer> indexes = StringExtensions.allIndexesOf(context, Pattern.compile("<div[^>]*data-ved=[^>]*>"));
        print(indexes, 30);
    }

